import React from 'react';

const Zip = props => {
    return (
        <div className="input-container">
            <input type="number"
                placeholder="5 Digit Number"
                value={props.zip}
                onChange={props.handleChange}
                name="zip"
                className="offer-input"
                />
        </div>
    )
}

export default Zip;
